// HasStrategy applies the HasEdge predicate on the "strategy" edge.
func HasStrategy() predicate.HyperOpt {
	return predicate.HyperOpt(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, StrategyTable, StrategyColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasStrategyWith applies the HasEdge predicate on the "strategy" edge with a given conditions (other predicates).
func HasStrategyWith(preds ...predicate.Strategy) predicate.HyperOpt {
	return predicate.HyperOpt(func(s *sql.Selector) {
		step := newStrategyStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.HyperOpt) predicate.HyperOpt {
	return predicate.HyperOpt(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.HyperOpt) predicate.HyperOpt {
	return predicate.HyperOpt(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.HyperOpt) predicate.HyperOpt {
	return predicate.HyperOpt(sql.NotPredicates(p))
}
